-- ----------------------------
-- Table structure for cms_article
-- ----------------------------
DROP TABLE IF EXISTS `cms_article`;
CREATE TABLE `cms_article` (
  `Id` bigint NOT NULL COMMENT '唯一编号',
  `TenantId` bigint DEFAULT NULL,
  `ColumnId` bigint NOT NULL DEFAULT '0' COMMENT '栏目Id',
  `Title` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '文章标题',
  `TitleColor` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '标题颜色',
  `SubTitle` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '副标题',
  `Author` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '作者',
  `Source` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '来源',
  `Sort` int NOT NULL DEFAULT '0' COMMENT '权重',
  `LinkUrl` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '外部链接地址',
  `Tag` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '标签',
  `ImgUrl` varchar(512) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '宣传图 支持多图',
  `VideoUrl` varchar(512) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '视频地址',
  `Status` bit(1) NOT NULL DEFAULT b'1' COMMENT '发布状态',
  `KeyWord` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT 'Seo关键字',
  `Summary` varchar(512) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT 'Seo描述',
  `Content` mediumtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci COMMENT '文章内容',
  `Attr` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '是否置顶',
  `Extend` varchar(2000) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT '[]' COMMENT '扩展选项',
  `Hits` int NOT NULL DEFAULT '0' COMMENT '点击量',
  `DayHits` int NOT NULL DEFAULT '0' COMMENT '当日点击量',
  `WeedHits` int NOT NULL DEFAULT '0' COMMENT '星期点击量',
  `MonthHits` int NOT NULL DEFAULT '0' COMMENT '月点击量',
  `LastHitDate` datetime DEFAULT NULL COMMENT '最后点击时间',
  `DeleteTime` datetime DEFAULT NULL COMMENT '删除时间',
  `PublishTime` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '发布日期',
  `CreateTime` datetime NOT NULL COMMENT '添加时间',
  `CreateUser` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '添加人',
  `UpdateTime` datetime NOT NULL COMMENT '修改时间',
  `UpdateUser` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '修改人',
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=DYNAMIC COMMENT='文章表 ';

