INSERT INTO `cms_article` (`Id`, `TenantId`, `ColumnId`, `Title`, `TitleColor`, `SubTitle`, `Author`, `Source`, `Sort`, `LinkUrl`, `Tag`, `ImgUrl`, `VideoUrl`, `Status`, `KeyWord`, `Summary`, `Content`, `Attr`, `Extend`, `Hits`, `DayHits`, `WeedHits`, `MonthHits`, `LastHitDate`, `DeleteTime`, `PublishTime`, `CreateTime`, `CreateUser`, `UpdateTime`, `UpdateUser`) VALUES (2008464697438900225, 0, 2006216743411912704, '利鑫集团发布年度可持续发展报告：绿色低碳转型初见成效', NULL, NULL, NULL, NULL, 0, NULL, '[]', '/upload/images/photo-1520607162513-77705c0f0d4a_1768449307.jpg', NULL, b'1', NULL, '报告显示，集团全年碳排放总量同比下降12%，绿色建筑覆盖率达80%，多项 ESG 关键指标持续改善。', '<p>报告显示，集团全年碳排放总量同比下降12%，绿色建筑覆盖率达80%，多项 ESG 关键指标持续改善。</p>\n<p>报告显示，集团全年碳排放总量同比下降12%，绿色建筑覆盖率达80%，多项 ESG 关键指标持续改善。</p>\n<p>&nbsp;</p>\n<p>报告显示，集团全年碳排放总量同比下降12%，绿色建筑覆盖率达80%，多项 ESG 关键指标持续改善。</p>\n<div class=\"template-alert\">\n<p>报告显示，集团全年碳排放总量同比下降12%，绿色建筑覆盖率达80%，多项 ESG 关键指标持续改善。</p>\n</div>\n<p>&nbsp;</p>', '[]', '[]', 8, 8, 8, 8, '2026-01-19 16:16:34', NULL, '2026-01-06 17:03:36', '2026-01-06 17:04:34', '付先生', '2026-01-15 16:10:03', '付先生');
INSERT INTO `cms_article` (`Id`, `TenantId`, `ColumnId`, `Title`, `TitleColor`, `SubTitle`, `Author`, `Source`, `Sort`, `LinkUrl`, `Tag`, `ImgUrl`, `VideoUrl`, `Status`, `KeyWord`, `Summary`, `Content`, `Attr`, `Extend`, `Hits`, `DayHits`, `WeedHits`, `MonthHits`, `LastHitDate`, `DeleteTime`, `PublishTime`, `CreateTime`, `CreateUser`, `UpdateTime`, `UpdateUser`) VALUES (2008465048003022848, 0, 2006216858650415104, '利鑫集团领导出席全球经济论坛，共议产业智能化与可持续发展', NULL, NULL, NULL, NULL, 0, NULL, '[\"经济论坛\",\"智能化\"]', '/upload/images/photo-1484154218962-a197022b5858_2_1768449347.jpg', NULL, b'1', NULL, '在论坛开幕式上，集团CEO发表“AI 与城市更新”的主题演讲，分享利鑫的实践与思考。', '<p>在论坛开幕式上，集团CEO发表&ldquo;AI 与城市更新&rdquo;的主题演讲，分享利鑫的实践与思考。</p>\n<p>&nbsp;</p>\n<p>在论坛开幕式上，集团CEO发表&ldquo;AI 与城市更新&rdquo;的主题演讲，分享利鑫的实践与思考。</p>\n<p>&nbsp;</p>\n<p>在论坛开幕式上，集团CEO发表&ldquo;AI 与城市更新&rdquo;的主题演讲，分享利鑫的实践与思考。</p>', '[1]', '[]', 9, 9, 9, 9, '2026-01-19 16:16:29', NULL, '2026-01-06 17:04:34', '2026-01-06 17:05:58', '付先生', '2026-01-15 11:55:48', '付先生');
INSERT INTO `cms_article` (`Id`, `TenantId`, `ColumnId`, `Title`, `TitleColor`, `SubTitle`, `Author`, `Source`, `Sort`, `LinkUrl`, `Tag`, `ImgUrl`, `VideoUrl`, `Status`, `KeyWord`, `Summary`, `Content`, `Attr`, `Extend`, `Hits`, `DayHits`, `WeedHits`, `MonthHits`, `LastHitDate`, `DeleteTime`, `PublishTime`, `CreateTime`, `CreateUser`, `UpdateTime`, `UpdateUser`) VALUES (2011709630287319040, 0, 2006207872475729920, '北京某社区居家卫浴适老化整体改造', NULL, NULL, NULL, NULL, 0, NULL, '[]', '/upload/images/photo-1484154218962-a197022b5858_2_1768463867.jpg', NULL, b'1', NULL, '针对老旧小区卫生间空间狭小、地面湿滑、照明不足等问题，进行一体化适老化设计与施工，显著降低长者夜间跌倒风险。', '<p>针对老旧小区卫生间空间狭小、地面湿滑、照明不足等问题，进行一体化适老化设计与施工，显著降低长者夜间跌倒风险。</p>\n<p>针对老旧小区卫生间空间狭小、地面湿滑、照明不足等问题，进行一体化适老化设计与施工，显著降低长者夜间跌倒风险。</p>', '[1]', '[{\"Key\":\"地址\",\"Value\":\"北京朝阳区\"}]', 2, 2, 2, 2, '2026-01-15 16:51:52', NULL, '2026-01-15 15:57:36', '2026-01-15 15:58:46', '付先生', '2026-01-15 16:41:54', '付先生');
INSERT INTO `cms_article` (`Id`, `TenantId`, `ColumnId`, `Title`, `TitleColor`, `SubTitle`, `Author`, `Source`, `Sort`, `LinkUrl`, `Tag`, `ImgUrl`, `VideoUrl`, `Status`, `KeyWord`, `Summary`, `Content`, `Attr`, `Extend`, `Hits`, `DayHits`, `WeedHits`, `MonthHits`, `LastHitDate`, `DeleteTime`, `PublishTime`, `CreateTime`, `CreateUser`, `UpdateTime`, `UpdateUser`) VALUES (2011709862261690368, 0, 2006207959427846144, '长三角某高端康养院整体规划与建设', NULL, NULL, NULL, NULL, 0, NULL, '[]', '/upload/images/photo-1517248135467-4c7edcad34c4_1768463971.jpg', NULL, b'1', NULL, '以“医养结合+智慧康养”为核心理念，从病房到公共空间统一规划适老化细节与智能系统，打造旗舰级示范项目。', '<p>以&ldquo;医养结合+智慧康养&rdquo;为核心理念，从病房到公共空间统一规划适老化细节与智能系统，打造旗舰级示范项目。</p>\n<p>以&ldquo;医养结合+智慧康养&rdquo;为核心理念，从病房到公共空间统一规划适老化细节与智能系统，打造旗舰级示范项目。</p>', '[]', '[]', 0, 0, 0, 0, NULL, NULL, '2026-01-15 15:59:03', '2026-01-15 15:59:42', '付先生', '2026-01-15 15:59:03', NULL);
INSERT INTO `cms_article` (`Id`, `TenantId`, `ColumnId`, `Title`, `TitleColor`, `SubTitle`, `Author`, `Source`, `Sort`, `LinkUrl`, `Tag`, `ImgUrl`, `VideoUrl`, `Status`, `KeyWord`, `Summary`, `Content`, `Attr`, `Extend`, `Hits`, `DayHits`, `WeedHits`, `MonthHits`, `LastHitDate`, `DeleteTime`, `PublishTime`, `CreateTime`, `CreateUser`, `UpdateTime`, `UpdateUser`) VALUES (2011709990095687681, 0, 2006208078671908864, '杭州某长者食堂无障碍与灯光优化改造', NULL, NULL, NULL, NULL, 0, NULL, '[]', '/upload/images/photo-1519494080410-f9aa76cb4283_1768464007.jpg', NULL, b'1', NULL, '通过坡道扶手、导视系统与视觉舒适的照明设计，让长者在公共用餐环境中行走更安全、辨识更清晰。', '<p>通过坡道扶手、导视系统与视觉舒适的照明设计，让长者在公共用餐环境中行走更安全、辨识更清晰。</p>\n<p>通过坡道扶手、导视系统与视觉舒适的照明设计，让长者在公共用餐环境中行走更安全、辨识更清晰。</p>', '[1]', '[{\"Key\":\"地址\",\"Value\":\"杭州市西湖区\"}]', 3, 3, 3, 3, '2026-01-16 14:02:15', NULL, '2026-01-15 15:59:42', '2026-01-15 16:00:12', '付先生', '2026-01-15 16:43:05', '付先生');
INSERT INTO `cms_article` (`Id`, `TenantId`, `ColumnId`, `Title`, `TitleColor`, `SubTitle`, `Author`, `Source`, `Sort`, `LinkUrl`, `Tag`, `ImgUrl`, `VideoUrl`, `Status`, `KeyWord`, `Summary`, `Content`, `Attr`, `Extend`, `Hits`, `DayHits`, `WeedHits`, `MonthHits`, `LastHitDate`, `DeleteTime`, `PublishTime`, `CreateTime`, `CreateUser`, `UpdateTime`, `UpdateUser`) VALUES (2011710263467839489, 0, 2006207959427846144, '智慧康养楼层走廊与起居空间一体化改造', NULL, NULL, NULL, NULL, 0, NULL, '[]', '/upload/images/photo-1517245386807-bb43f82c33c4_1768464071.jpg', NULL, b'1', NULL, '结合智慧感应照明、统一扶手系统与休息区布局优化，使整层动线更清晰、安全，为多位长者同时活动提供舒适环境。', '<p>结合智慧感应照明、统一扶手系统与休息区布局优化，使整层动线更清晰、安全，为多位长者同时活动提供舒适环境。</p>\n<p>结合智慧感应照明、统一扶手系统与休息区布局优化，使整层动线更清晰、安全，为多位长者同时活动提供舒适环境。</p>', '[1]', '[{\"Key\":\"地址\",\"Value\":\"上海市徐汇区\"}]', 3, 3, 3, 3, '2026-01-15 16:27:30', NULL, '2026-01-15 16:00:12', '2026-01-15 16:01:17', '付先生', '2026-01-15 16:42:49', '付先生');
COMMIT;

-- ----------------------------
-- Table structure for cms_column
-- ----------------------------
DROP TABLE IF EXISTS `cms_column`;
CREATE TABLE `cms_column` (
  `Id` bigint NOT NULL COMMENT '唯一编号',
  `TenantId` bigint DEFAULT NULL,
  `ParentId` bigint NOT NULL DEFAULT '0' COMMENT '父编号',
  `ParentIdList` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '父编号集合',
  `Number` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '栏目编号',
  `Title` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '栏目标题',
  `EnTitle` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '栏目英文标题',
  `SubTitle` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '栏目副标题',
  `Layer` int NOT NULL DEFAULT '1' COMMENT '层级',
  `Sort` int NOT NULL DEFAULT '1' COMMENT '排序',
  `Status` bit(1) NOT NULL DEFAULT b'1' COMMENT '状态',
  `SiteId` bigint NOT NULL DEFAULT '0' COMMENT '站点ID',
  `TemplateId` bigint NOT NULL DEFAULT '0' COMMENT '模板ID',
  `TemplateName` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '模板名称',
  `ImgUrl` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '栏目图片',
  `LinkUrl` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '栏目外链',
  `KeyWord` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '栏目关键字',
  `Summary` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '栏目描述',
  `Content` mediumtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci COMMENT '栏目内容',
  `CreateTime` datetime DEFAULT NULL COMMENT '添加时间',
  `CreateUser` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '添加人',
  `UpdateTime` datetime DEFAULT NULL COMMENT '修改时间',
  `UpdateUser` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '修改人',
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=DYNAMIC COMMENT='栏目表 ';

