-- ----------------------------
-- Table structure for cms_product
-- ----------------------------
DROP TABLE IF EXISTS `cms_product`;
CREATE TABLE `cms_product` (
  `id` bigint NOT NULL COMMENT '主键，程序生成 Id',
  `tenant_id` bigint NOT NULL DEFAULT '0' COMMENT '租户 Id',
  `column_id` bigint NOT NULL COMMENT '所属栏目/分类 Id',
  `title` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '产品名称',
  `sub_title` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '产品副标题',
  `product_no` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '产品编号/货号',
  `unit` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '计量单位，如件/箱/套',
  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '销售价',
  `market_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '市场价',
  `cost_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '成本价',
  `img_url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '封面图',
  `album` json DEFAULT NULL COMMENT '产品相册(多图 JSON 数组)',
  `tags` json DEFAULT NULL COMMENT '标签(JSON 数组)',
  `extend` json DEFAULT NULL COMMENT '自定义参数',
  `intro` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '简要介绍',
  `content` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci COMMENT '详细介绍/图文内容',
  `sort` int NOT NULL DEFAULT '0' COMMENT '排序(值越大越靠前)',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态(1=上架,0=下架)',
  `hits` int NOT NULL DEFAULT '0' COMMENT '总点击量',
  `day_hits` int NOT NULL DEFAULT '0' COMMENT '当日点击量',
  `weed_hits` int NOT NULL DEFAULT '0' COMMENT '本周点击量',
  `month_hits` int NOT NULL DEFAULT '0' COMMENT '本月点击量',
  `last_hit_date` datetime DEFAULT NULL COMMENT '最后点击时间',
  `publish_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '发布时间',
  `delete_time` datetime DEFAULT NULL COMMENT '删除时间(逻辑删除)',
  `create_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `create_user` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '创建人',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `update_user` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '修改人',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='产品表';

-- ----------------------------
-- Records of cms_product
-- ----------------------------
BEGIN;
