-- ----------------------------
-- Table structure for sys_adv_info
-- ----------------------------
DROP TABLE IF EXISTS `sys_adv_info`;
CREATE TABLE `sys_adv_info` (
  `Id` bigint NOT NULL COMMENT '唯一编号',
  `TenantId` bigint DEFAULT NULL,
  `ColumnId` bigint NOT NULL DEFAULT '0' COMMENT '栏目Id',
  `Title` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '广告名称',
  `Types` int NOT NULL DEFAULT '1' COMMENT '广告位类型',
  `Status` bit(1) NOT NULL DEFAULT b'1' COMMENT '状态',
  `ImgUrl` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '广告位图片',
  `LinkUrl` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '连接地址',
  `Target` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '跳转方式',
  `Summary` varchar(512) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '描述',
  `Codes` varchar(512) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '广告位代码',
  `IsTimeLimit` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否开启时间限制',
  `BeginTime` datetime DEFAULT NULL COMMENT '开始时间',
  `EndTime` datetime DEFAULT NULL COMMENT '结束时间',
  `Sort` int NOT NULL DEFAULT '1' COMMENT '排序',
  `Hits` int NOT NULL DEFAULT '0' COMMENT '广告点击率',
  `CreateTime` datetime DEFAULT NULL COMMENT '添加时间',
  `CreateUser` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '添加人',
  `UpdateTime` datetime DEFAULT NULL COMMENT '修改时间',
  `UpdateUser` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '修改人',
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=DYNAMIC COMMENT='广告位信息表 ';

-- ----------------------------
-- Records of sys_adv_info
-- ----------------------------
BEGIN;
INSERT INTO `sys_adv_info` (`Id`, `TenantId`, `ColumnId`, `Title`, `Types`, `Status`, `ImgUrl`, `LinkUrl`, `Target`, `Summary`, `Codes`, `IsTimeLimit`, `BeginTime`, `EndTime`, `Sort`, `Hits`, `CreateTime`, `CreateUser`, `UpdateTime`, `UpdateUser`) VALUES (2008749909985071105, 0, 1, '利鑫康养<br>守护长者尊严', 1, b'1', '/upload/images/photo-1576765608535-5f04d1e3f289_compressed_1768446428.jpg', NULL, '_blank', '为您提供专业的一站式居家养老产品与环境优化方案，让关爱更有温度，让晚年生活更安全、更体面。', '专注适老化改造与智能辅具', b'0', NULL, NULL, 10, 0, '2026-01-07 11:49:22', '付先生', '2026-01-15 17:09:21', '付先生');
INSERT INTO `sys_adv_info` (`Id`, `TenantId`, `ColumnId`, `Title`, `Types`, `Status`, `ImgUrl`, `LinkUrl`, `Target`, `Summary`, `Codes`, `IsTimeLimit`, `BeginTime`, `EndTime`, `Sort`, `Hits`, `CreateTime`, `CreateUser`, `UpdateTime`, `UpdateUser`) VALUES (2008750148703883264, 0, 1, 'LX 系列智能护理床<br>减轻家属照护压力', 1, b'1', '/upload/images/photo-1516549655169-df83a0774514_1_1768447141.jpg', NULL, '_blank', '集成语音控制、自动翻身与离床监测，让长者起身、进食、休息更安全、更省力，减轻照护家庭的日常负担。', '智能护理床 · 专为长期照护设计', b'0', NULL, NULL, 8, 0, '2026-01-07 11:49:22', '付先生', '2026-01-15 11:19:04', '付先生');
INSERT INTO `sys_adv_info` (`Id`, `TenantId`, `ColumnId`, `Title`, `Types`, `Status`, `ImgUrl`, `LinkUrl`, `Target`, `Summary`, `Codes`, `IsTimeLimit`, `BeginTime`, `EndTime`, `Sort`, `Hits`, `CreateTime`, `CreateUser`, `UpdateTime`, `UpdateUser`) VALUES (2008750308582363137, 0, 1, '从浴室开始<br>降低跌倒风险', 1, b'1', '/upload/images/photo-1551601651-2a8555f1a136_1768447183.jpg', NULL, '_blank', '通过防滑地面、坐式淋浴和合理扶手布局，结合紧急呼叫系统，打造真正安全、易打理的长者卫浴空间。', '卫浴适老化整体方案', b'0', NULL, NULL, 5, 0, '2026-01-07 11:49:22', '付先生', '2026-01-15 11:19:45', '付先生');
INSERT INTO `sys_adv_info` (`Id`, `TenantId`, `ColumnId`, `Title`, `Types`, `Status`, `ImgUrl`, `LinkUrl`, `Target`, `Summary`, `Codes`, `IsTimeLimit`, `BeginTime`, `EndTime`, `Sort`, `Hits`, `CreateTime`, `CreateUser`, `UpdateTime`, `UpdateUser`) VALUES (2011618318984810496, 0, 1, '康复训练 · 运动防跌倒', 1, b'1', '/upload/images/photo-1579684385127-1ef15d508118_1768447209.jpg', NULL, '_blank', '为社区与养老机构提供一站式康复训练区规划，结合生命体征监测，实现“早发现、早干预”的主动健康管理。', '社区与机构康养空间升级', b'0', NULL, NULL, 1, 0, '2026-01-07 11:49:22', '付先生', '2026-01-15 11:20:11', '付先生');
COMMIT;

-- ----------------------------
-- Table structure for sys_code
-- ----------------------------
DROP TABLE IF EXISTS `sys_code`;
CREATE TABLE `sys_code` (
  `Id` bigint NOT NULL COMMENT '唯一编号',
  `TypeId` bigint NOT NULL COMMENT '分类编号',
  `Tag` int NOT NULL DEFAULT '1' COMMENT '对应CodeType的Type',
  `Name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '字典值名称',
  `CodeValues` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '字典值阈值',
  `Sort` int NOT NULL DEFAULT '1' COMMENT '排序',
  `Status` bit(1) NOT NULL DEFAULT b'1' COMMENT '状态',
  `IsDel` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否删除',
  `Summary` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '备注',
  `CreateTime` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `CreateUser` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '创建人',
  `UpdateTime` datetime DEFAULT NULL COMMENT '修改时间',
  `UpdateUser` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '修改人',
  `TenantId` bigint NOT NULL DEFAULT '0' COMMENT '租户编号',
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=DYNAMIC COMMENT='字典信息表';

-- ----------------------------
-- Records of sys_code
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for sys_codetype
-- ----------------------------
DROP TABLE IF EXISTS `sys_codetype`;
CREATE TABLE `sys_codetype` (
  `Id` bigint NOT NULL COMMENT '唯一编号',
  `ParentId` bigint NOT NULL COMMENT '父节点',
  `ParentIdList` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL,
  `Layer` int NOT NULL DEFAULT '1' COMMENT '层级',
  `Name` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '分类名称',
  `Code` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '标识',
  `Types` int NOT NULL DEFAULT '1' COMMENT '1=系统 2=商城',
  `Sort` int NOT NULL DEFAULT '1' COMMENT '排序',
  `IsSystem` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否系统内置集成',
  `IsDel` bit(1) NOT NULL DEFAULT b'0' COMMENT '是否删除',
  `CreateTime` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `CreateUser` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '创建人',
  `UpdateTime` datetime DEFAULT NULL COMMENT '修改时间',
  `UpdateUser` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '修改人',
  `TenantId` bigint NOT NULL DEFAULT '0' COMMENT '租户编号',
  PRIMARY KEY (`Id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=DYNAMIC COMMENT='字典分类信息';

-- ----------------------------
-- Records of sys_codetype
-- ----------------------------
BEGIN;
COMMIT;

-- ----------------------------
-- Table structure for sys_employment
-- ----------------------------
DROP TABLE IF EXISTS `sys_employment`;
CREATE TABLE `sys_employment` (
  `id` bigint unsigned NOT NULL DEFAULT '0' COMMENT '主键：任用ID',
  `tenant_id` bigint unsigned NOT NULL COMMENT '租户ID（逻辑外键：sys_tenant.id）',
  `user_id` bigint unsigned NOT NULL COMMENT '用户ID（逻辑外键：sys_user_account.id）',
  `org_id` bigint unsigned NOT NULL COMMENT '组织ID（逻辑外键：sys_org_unit.id）',
  `position_id` bigint unsigned NOT NULL COMMENT '岗位ID（逻辑外键：sys_position.id）',
  `is_primary` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否主任用：1主 0兼职',
  `valid_from` datetime(3) NOT NULL COMMENT '任用生效时间（UTC）',
  `valid_to` datetime(3) DEFAULT NULL COMMENT '任用失效时间（UTC，NULL 表示当前有效）',
  `note` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '备注（如试用/借调等）',
  `created_at` datetime(3) NOT NULL DEFAULT CURRENT_TIMESTAMP(3) COMMENT '创建时间（UTC）',
  `updated_at` datetime(3) NOT NULL DEFAULT CURRENT_TIMESTAMP(3) ON UPDATE CURRENT_TIMESTAMP(3) COMMENT '更新时间（UTC）',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_sys_emp_unique` (`tenant_id`,`user_id`,`org_id`,`position_id`,`valid_from`),
  KEY `idx_sys_emp_tenant_user` (`tenant_id`,`user_id`),
  KEY `idx_sys_emp_tenant_org` (`tenant_id`,`org_id`),
  KEY `idx_sys_emp_tenant_pos` (`tenant_id`,`position_id`),
  KEY `idx_sys_emp_valid_range` (`tenant_id`,`valid_from`,`valid_to`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='【任用】用户在某组织担任某岗位的关系；支持历史与多岗位';

-- ----------------------------
-- Records of sys_employment
-- ----------------------------
