-- ----------------------------
-- Table structure for sys_org_unit
-- ----------------------------
DROP TABLE IF EXISTS `sys_org_unit`;
CREATE TABLE `sys_org_unit` (
  `id` bigint unsigned NOT NULL COMMENT '主键：组织ID',
  `tenant_id` bigint unsigned NOT NULL COMMENT '租户ID（逻辑外键：sys_tenant.id）',
  `code` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '组织编码（租户内唯一）',
  `name` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '组织名称（部门/团队/分公司等）',
  `parent_id` bigint unsigned DEFAULT '0' COMMENT '父组织ID（逻辑外键：sys_org_unit.id；根组织为空）',
