  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_sys_org_code` (`tenant_id`,`code`),
  KEY `idx_sys_org_tenant` (`tenant_id`),
  KEY `idx_sys_org_parent` (`tenant_id`,`parent_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='【组织】树形结构的部门/项目/业务单元；与 sys_org_unit_closure 支持祖先后代查询';

