-- ----------------------------
-- Table structure for sys_position
-- ----------------------------
DROP TABLE IF EXISTS `sys_position`;
CREATE TABLE `sys_position` (
  `id` bigint unsigned NOT NULL COMMENT '主键：岗位ID',
  `tenant_id` bigint unsigned NOT NULL COMMENT '租户ID（逻辑外键：sys_tenant.id）',
  `code` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '岗位编码（租户内唯一）',
  `name` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '岗位名称（如：部门经理、财务专员）',
  `parent_id` bigint unsigned DEFAULT NULL COMMENT '父岗位ID（逻辑外键：sys_position.id；可空）',
  `is_managerial` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否管理序列：1是 0否（参考字段）',
  `is_active` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否启用',
  `created_at` datetime(3) NOT NULL DEFAULT CURRENT_TIMESTAMP(3) COMMENT '创建时间（UTC）',
  `updated_at` datetime(3) NOT NULL DEFAULT CURRENT_TIMESTAMP(3) ON UPDATE CURRENT_TIMESTAMP(3) COMMENT '更新时间（UTC）',
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_sys_pos_code` (`tenant_id`,`code`),
  KEY `idx_sys_pos_tenant` (`tenant_id`),
  KEY `idx_sys_pos_parent` (`tenant_id`,`parent_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='【岗位】岗位/职级目录，支持层级（如经理/主管/专员等）';

