-- ----------------------------
-- Table structure for wf_definition
-- ----------------------------
DROP TABLE IF EXISTS `wf_definition`;
CREATE TABLE `wf_definition` (
  `Id` bigint NOT NULL DEFAULT '0' COMMENT '主键Id（自行生成）',
  `TenantId` bigint NOT NULL DEFAULT '0' COMMENT '租户Id',
  `DefKey` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '流程编码，如 LEAVE_APPLY',
  `DefName` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '流程名称',
  `Version` int NOT NULL DEFAULT '1' COMMENT '版本号，从1递增',
  `Status` tinyint NOT NULL DEFAULT '0' COMMENT '状态：0=草稿,1=已发布,2=停用',
  `Category` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '所属模块/分类',
  `FormSchemaId` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '绑定表单/页面标识',
  `Remark` varchar(512) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '备注',
  `CreatedBy` bigint NOT NULL DEFAULT '0' COMMENT '创建人Id',
  `CreatedAt` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `UpdatedBy` bigint NOT NULL DEFAULT '0' COMMENT '最后更新人Id',
  `UpdatedAt` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  PRIMARY KEY (`Id`),
  KEY `idx_wf_def_tenant_key_ver` (`TenantId`,`DefKey`,`Version`),
  KEY `idx_wf_def_status` (`TenantId`,`Status`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='流程定义';

