-- ----------------------------
-- Table structure for wf_form
-- ----------------------------
DROP TABLE IF EXISTS `wf_form`;
CREATE TABLE `wf_form` (
  `Id` bigint NOT NULL DEFAULT '0' COMMENT '主键 Id',
  `TenantId` bigint NOT NULL DEFAULT '0' COMMENT '租户 Id',
  `Code` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '表单编码（唯一）',
  `Name` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '表单名称',
  `SchemaJson` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '表单设计 JSON（设计器画布 + 表单配置）',
  `RoutePath` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '前端路由路径（可选）',
  `Status` tinyint NOT NULL DEFAULT '0' COMMENT '状态：0=草稿,1=启用,2=停用',
  `Remark` varchar(500) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '备注',
  `CreatedBy` bigint NOT NULL DEFAULT '0' COMMENT '创建人 Id',
  `CreatedAt` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `UpdatedBy` bigint NOT NULL DEFAULT '0' COMMENT '最后更新人 Id',
  `UpdatedAt` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '最后更新时间',
  PRIMARY KEY (`Id`),
  KEY `IX_wf_form_TenantId` (`TenantId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='工作流：表单定义';

-- ----------------------------
-- Records of wf_form
-- ----------------------------
