-- ----------------------------
-- Table structure for wf_instance
-- ----------------------------
DROP TABLE IF EXISTS `wf_instance`;
CREATE TABLE `wf_instance` (
  `Id` bigint NOT NULL DEFAULT '0' COMMENT '主键Id',
  `TenantId` bigint NOT NULL DEFAULT '0' COMMENT '租户Id',
  `DefinitionId` bigint NOT NULL DEFAULT '0' COMMENT '流程定义Id',
  `DefinitionKey` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '流程定义编码（冗余）',
  `BusinessKey` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '业务主键，如单据Id',
  `Title` varchar(256) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '流程标题（含业务信息）',
  `StartUserId` bigint NOT NULL DEFAULT '0' COMMENT '发起人Id',
  `StartUserName` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '发起人名称',
  `StartTime` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '开始时间',
  `EndTime` datetime DEFAULT NULL COMMENT '结束时间',
  `Status` tinyint NOT NULL DEFAULT '0' COMMENT '状态：0=运行中,1=已完成,2=已终止,3=已撤回',
  `CurrentNodeIds` varchar(512) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '当前活跃节点Id列表(JSON或逗号分隔)',
  `CreatedAt` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `UpdatedAt` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`Id`),
  KEY `idx_wf_inst_tenant_def` (`TenantId`,`DefinitionKey`),
  KEY `idx_wf_inst_business` (`TenantId`,`BusinessKey`),
  KEY `idx_wf_inst_status` (`TenantId`,`Status`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='流程实例';

-- ----------------------------
-- Records of wf_instance
-- ----------------------------
BEGIN;
INSERT INTO `wf_instance` (`Id`, `TenantId`, `DefinitionId`, `DefinitionKey`, `BusinessKey`, `Title`, `StartUserId`, `StartUserName`, `StartTime`, `EndTime`, `Status`, `CurrentNodeIds`, `CreatedAt`, `UpdatedAt`) VALUES (2004109576147963904, 0, 2004013096624066560, 'FYT_TEST', 'BIZ_2004109575804030976', '测试流程', 1678330902595375105, '付先生', '2025-12-25 16:38:52', '2025-12-25 16:39:57', 1, NULL, '2025-12-25 16:38:52', '2025-12-25 16:39:57');
COMMIT;

-- ----------------------------
-- Table structure for wf_instance_history
-- ----------------------------
DROP TABLE IF EXISTS `wf_instance_history`;
CREATE TABLE `wf_instance_history` (
  `Id` bigint NOT NULL DEFAULT '0' COMMENT '主键Id',
  `TenantId` bigint NOT NULL DEFAULT '0' COMMENT '租户Id',
  `InstanceId` bigint NOT NULL DEFAULT '0' COMMENT '实例Id',
  `EventType` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '事件类型，如 START, COMPLETE, TERMINATE, RECALL',
  `FromStatus` tinyint DEFAULT NULL COMMENT '变更前状态',
  `ToStatus` tinyint DEFAULT NULL COMMENT '变更后状态',
  `OperatorId` bigint NOT NULL DEFAULT '0' COMMENT '操作人Id',
  `OperatorName` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '操作人名称',
  `Remark` varchar(1024) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '说明',
  `CreatedAt` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`Id`),
  KEY `idx_wf_inst_hist_inst` (`TenantId`,`InstanceId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='流程实例历史';

-- ----------------------------
