-- ----------------------------
-- Table structure for wf_task
-- ----------------------------
DROP TABLE IF EXISTS `wf_task`;
CREATE TABLE `wf_task` (
  `Id` bigint NOT NULL DEFAULT '0' COMMENT '主键Id',
  `TenantId` bigint NOT NULL DEFAULT '0' COMMENT '租户Id',
  `InstanceId` bigint NOT NULL DEFAULT '0' COMMENT '流程实例Id',
  `NodeId` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '节点Id（设计器中的节点key）',
  `NodeName` varchar(128) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NOT NULL COMMENT '节点名称',
  `AssigneeId` bigint NOT NULL DEFAULT '0' COMMENT '当前处理人Id（单人）',
  `AssigneeName` varchar(64) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '处理人名称',
  `Status` tinyint NOT NULL DEFAULT '0' COMMENT '任务状态：0=待处理,1=已处理,2=已转办,3=已撤回',
  `Action` varchar(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '最终动作：agree/reject/transfer等',
  `LevelIndex` int DEFAULT NULL COMMENT '连续主管审批索引',
  `Comment` varchar(1024) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '审批意见',
  `CreatedAt` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `CompletedAt` datetime DEFAULT NULL COMMENT '完成时间',
  PRIMARY KEY (`Id`),
  KEY `idx_wf_task_tenant_assignee` (`TenantId`,`AssigneeId`,`Status`),
  KEY `idx_wf_task_instance` (`TenantId`,`InstanceId`),
  KEY `idx_wf_task_node` (`TenantId`,`NodeId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci COMMENT='流程任务';

